"""DESCARGAR Y TRANFORMAR LOS DATOS

-Con transforms de torchvision vamos a poder aplicar transoformaciones sobre las imagenes, que con su método Compose vamos a poder encadenar.
Simplemente vamos a convertir las imagenes en Tensores para poder trabajar con ellas y vamos a normalizar sus valores, no vamos a aplicar ninguna transformación adicional.

-Dataloader para cargar y iterar los datos de manera eficiente.

En este caso separamos los datos en Train, Test y Val.
Por ultimo creamos las difenretes clases en las que se encuentran clasificados los datos de CIFAR-10
"""

trans = torchvision.transforms.Compose(
    [torchvision.transforms.ToTensor(),
     torchvision.transforms.Normalize((0.5, 0.5, 0.5), (0.5, 0.5, 0.5))])

train = torchvision.datasets.CIFAR10(root='./data', train=True,download=True,transform=trans)
trainloader = torch.utils.data.DataLoader(train,batch_size=32,shuffle=True)

