"""DEFINICIÓN DE FUNCIÓN DE ENTRENAMIENTO"""

def accuracy(model,loader):
  num_correct = 0
  num_total = 0
  model.eval()
  model = model.to(device=device)
  with torch.no_grad():            #no_grad para deshabilitar el gradiente local si no se va a utilizar, para reducir consumo
    for xi,yi in loader:
      xi = xi.to(device=device,dtype= torch.float32)
      yi = yi.to(device=device ,dtype=torch.long)
      scores= model(xi)
      _, pred = scores.max(dim=1)
      num_correct += (pred == yi).sum()
      num_total += pred.size(0)
  return float(num_correct)/num_total

def train(model,optim,epochs):
  since = time.time()
  total_acc = []
  i=0
  model = model.to(device=device)
  for epoch in range(epochs):
    for i,(xi,yi) in enumerate(trainloader):   # xi imagen yi label
      model.train()
      xi = xi.to(device=device,dtype=torch.float32) #soporte de gpu o cpu con device y pasar a tipo de dato float32
      yi = yi.to(device=device,dtype=torch.long)    #soporte gpu o cpu con device 
      scores=model(xi)
      cost= F.cross_entropy(input=scores,target=yi)
      optim.zero_grad()
      cost.backward()
      optim.step()
    acc = accuracy(model,valoader) #calculamos con los datos de validacion
    total_acc.append(acc)   #lista con cada acc por epoch para luego hacer graficas
  
    time_ep = time.time() -since
    print('Epoch: {} Loss: {:.4f} Acc: {} Time: {:.0f}m {:.0f}s'.format(
        epoch+1, cost.item(),acc,time_ep//60,time_ep%60))
  time_elapsed = time.time() -since
  print('Tiempo total {:.0f}m {:.0f}s'.format(
        time_elapsed // 60, time_elapsed % 60))
  final_acc = accuracy(model,testloader)   #calculamos con los datos de test
  print('Acc:',final_acc)
  return model,total_acc

