class iden_block(nn.Module):
  def __init__(self, in_channels, out_channels, stride=1,downsample=None):
    super(iden_block,self).__init__()
    self.conv1 = nn.Conv2d(64,64,3,1,1)
    self.bn1 = nn.BatchNorm2d(64)
    self.relu1 = nn.ReLU()
    self.conv2 = nn.Conv2d(64,64,3,1,1)
    self.bn2 = nn.BatchNorm2d(64)
    self.relu2 = nn.ReLU()
    self.pool1 = nn.MaxPool2d(2,2)

  def forward(self, x):               
    out = self.conv1(x)         #aplicamos bloque normal, conv,batch,relu,conv,batch y unimos el identidad
    out = self.bn1(out)
    out = self.relu1(out)
    out = self.conv2(out)
    out = self.bn2(out)
    out += x                  #union de aplicar bloque + identidad
    out = self.relu2(out)

    return out


class conv_block(nn.Module):
  def __init__(self, in_channels, out_channels, stride=1,downsample=None):
    super(conv_block,self).__init__()
    self.conv1 = nn.Conv2d(in_channels,out_channels,3,stride,padding=1)
    self.bn1 = nn.BatchNorm2d(out_channels)
    self.relu1 = nn.ReLU()
    self.conv2 = nn.Conv2d(in_channels,out_channels,3,stride,padding=1)
    self.bn2 = nn.BatchNorm2d(out_channels)
    self.relu2 = nn.ReLU()
    self.pool1 = nn.MaxPool2d(2,2)
    self.downsample = downsample

  def forward(self, x):  
    res = x             
    out = self.conv1(x)         #aplicamos bloque normal, conv,batch,relu,conv,batch y unimos el identidad
    out = self.bn1(out)
    out = self.relu1(out)
    out = self.conv2(out)
    out = self.bn2(out)
    if self.downsample:
            residual = self.downsample(x)
    out += res               #union de aplicar bloque + residual
    out = self.relu2(out)
    return out

class ResNet_2(nn.Module):
  def __init__(self):
    super(ResNet_2,self).__init__()
    self.conv = nn.Conv2d(64,64,3,1,1)
    self.identblock1 = iden_block(128,128)
    self.resblock1 =  conv_block(128,128)
    self.identblock2 = iden_block(256,256)
    self.resblock2 =  conv_block(256,256)
    self.pool = nn.MaxPool2d(2,2)
    self.fc = nn.Linear(256*8*8, 10)
  
  def forward(self,x):
    out = self.conv(x)
    out = self.identblock1(out)
    out = self.resblock1(out)
    out = self.pool(out)
    out = self.identblock2(out)
    out = self.resblock1(out)
    out = self.pool(out)
    out = out.view(out.size(0), -1)
    out = self.fc(out)

ResNet_2 = ResNet_2().to(device)
optim= torch.optim.Adam(ResNet_2.parameters(),lr=0.001)
resnet,tot_acc =train(ResNet_2,optim,30)